import axios from "axios";
import { useState } from 'react';


function Fourth() {

    const [ output, setOutput ] = useState('0000')
    // const [ input, setInput  ] = useState(0)


    return (
        <div className='container'>
            Yo Yo this is fourth
            <input type='int' id='testinput'/>
            <button onClick={()=>
                axios({
                    method: 'post',
                    url: '/test/',
                    data: {
                        value: document.getElementById('testinput'),
                        testdata2: 'Talofa'
                        }
                    })
                .then(
                    (res)=>setOutput(res.data))}>
                Submit
            </button>
            {output}
        </div>
    )
}

export default Fourth
